    false,nt"url": null,nt"notes": "Flood waters which impacted the Stillwater
    Wildlife Management Area for the past several years also had their effect on the
    northern portions of the Canvasback Gun Club. At survey time the flood waters had
    receded considerably exposing barren areas.    Previous reports indicate few if
    any submergents in large water areas north of the main east-west road. This held
    true in this survey as well. These large water areas included Dutch Bill Lake, the
    Mallard Lakes, and Sans. Freeman Lakes to the south also had few if any submerged
    plants.    Conservative livestock grazing practices are believed to have contributed
    to the high quality waterfowl habitat found in the small pond areas in the southern
    portion of the area.    At survey time water levels were getting higher in the southern
    ponds. More water was also being provided to Dutch Bill Lake.    More submerged
    plant species were found on the Canvasback compared to the adjacent Stillwater National
    Wildlife Refuge. It appears that the central and southern areas of the Canvasback
    have better soils than those found on the Stillwater National Wildlife Refuge.",nt"license_title":
